import React from 'react';
import Footer from './components/Footer';
import Header from './components/Header';
import Startseite from './components/Startseite';

function MyApp(){
    return(
    <div>
        <Header/>
        <Startseite/>
        <Footer/>
    </div>
    );
}

export default MyApp;
